import React from "react";
import { withRouter } from "react-router-dom";
import "../../App.css";
import loginImg from "../../money.svg";
import {Redirect, Link} from "react-router-dom";
import { 
    INDEX_PATH
   } from "../../constants/pageNames";

class AdminPage extends React.Component {

    constuctor(props) {
        this.routeChange = this.routeChange.bind(this);
    }

    routeChange() {
        this.props.history.push(INDEX_PATH);
    }

    render(){
        return(

            <div className="admin-top-left-container">
                <div className="logo">
                    <img src={loginImg}/>
                </div>
                <div className="admin-top-middle-container">
                    Powered By EduPay
                </div>
                <div className="admin-top-right-container">
                    <button className="btn"  onClick={this.routeChange}>
                        Logout
                    </button>
                </div>

            </div>

        )
    }

}

export default AdminPage;
